function ConvertUrl() {
    return (
        <div className="container">
            <h1>URL SHORTENER</h1>
        <div className="information">
            <form action="">
                <div className="mb-3">
                    <input type="text" class="form-control form-control-lg" placeholder="Shorten your link" />
                </div>
            </form>
        </div>
        </div>
        
        
    );
}

export default ConvertUrl;
